import './App.css';
import AddStudent from './components/AddStudent';
import Header from './components/Header';
import {BrowserRouter as Router, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
        <div>
             <Header/>

             <Route path="/add" exact Component={AddStudent}/>


        </div>
    </Router>

  );
}

export default App;
